import React from "react";
import Node from './PathfindingVisualizer/Node/Node.jsx'

export default function Legend() {
    return (
        <div className='Legend'>
            <div className='Legend-item'>
                <Node 
                    isStart = {false}
                    isFinish= {false}
                    actualValue={0}
                ></Node>
                {' '} = Empty Square
            </div>
            <div className='Legend-item'>
                <Node 
                    isStart = {true}
                    isFinish= {false}
                ></Node>
                {' '} = Current Square
            </div>
            <div className='Legend-item'>
                <Node 
                    isStart = {false}
                    isFinish= {true}
                ></Node>
                {' '} = Wrong Value Square
            </div>
        </div>
    )
}
